text:
If the government were not shut down, we would have received the latest official report today on jobs and unemployment. Instead, it‚Äôs the second straight missing report, leaving employers, workers and policymakers trying to understand the labor picture without crucial data.

One thing seems clear: The labor market may not be cratering, but it does not look very strong. This week, one private report found that 42,000 new jobs were created last month. Then a separate report found that more than 150,000 jobs were cut in October ‚Äî the highest in over two decades ‚Äî and tied in part to the AI boom.

@PaulSolman has been looking into the most recent official unemployment numbers and questions over whether the government‚Äôs own measurements are outdated.

